// src/pages/Events.js
import React from 'react';
import Calendar from '../components/Calendar';
import './Events.css'; // Ensure to import your styles

const Events = () => {
    const events = [
        { id: 1, date: '2024-10-07', title: 'Event 1' },
        { id: 2, date: '2024-10-09', title: 'Event 2' },
        { id: 3, date: '2024-10-10', title: 'Event 3' },
    ];

    return (
        <div className="events-page">
            <h1>Events Page</h1>
            <div className="calendar-container">
                <Calendar events={events} />
            </div>
            <div className="main-container">
                <div className="filters">
                    <div className="filter-card">
                        <h3>Filters</h3>
                        {/* Add your filter options here */}
                        <div className="filter-options">
                            <button>Upcoming Events</button>
                            <button>Past Events</button>
                            <button>Categories</button>
                        </div>
                    </div>
                    {/* Add more filter cards as needed */}
                </div>
                <div className="event-cards">
                    {events.map(event => (
                        <div key={event.id} className="dispEvent">
                            <h4>{event.title}</h4>
                            <p>Date: {event.date}</p>
                            {/* Add more event details as needed */}
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default Events;
